function Ndanh() {
  return (
    <div className="slide_picture">
      <div className="chuyen-slide">
        <div className="slide-tintuc">
          <a href="true">
            <img src="img/anhtin1.png" alt="true" />
          </a>{' '}
        </div>{' '}
        <div className="slide-tintuc">
          <a href="true">
            <img src="img/anhtin1.png" alt="true" />
          </a>{' '}
        </div>{' '}
        <div className="slide-tintuc">
          <a href="true">
            <img src="img/anhtin1.png" alt="true" />
          </a>{' '}
        </div>{' '}
      </div>{' '}
      <p className="prev" onclick="Back(0)">
        {' '}
        ❮
      </p>{' '}
